import React , {Component} from "react";
import '../style.css';
import '../style1.css';
//import Cities from '../cities.json'

class Ul extends Component{ 
    //البناء
constructor(){
super()
this.state = {
     pageNamer: []
}
console.log(this.state.pageNamer)
}







 //الكتابه

render(){
    for (var a = 2 ; a < 5 ; a++ ){
      return this.state.pageNamer.push(<li >a</li>)

    }
    
return(
        <div>
            
            <ul id="pagintion-ul">
            
               {this.state.pageNamer }
            </ul>
        </div>
    )}
}
export default Ul;
